const displayReducer = (state = ['display', 'mainMenu'], action) => {
  let className;
  state.forEach((item) => {
    console.log(item);
  });
  switch (action.type) {
    case 'SET_DISPLAY':
      console.log(action.payload);

      return;
    default:
      return state;
  }
};

export default displayReducer;
